import React from 'react';
import './custom-button.styles.scss';

const CustomButton = ({children , isGoogleSignIn, isCollectionItem, ...otherProps }) => (
    <button className={`${isGoogleSignIn ? 'google-sign-in': ''}${isCollectionItem ? 'collection-item': ''}custom-button`} {...otherProps}>
        {children}
    </button>
)

export default CustomButton;
